#include <iostream>#include <stack>#include <string>using namespace std;stack<int> a;string b;int main() {	int N,num;	cin >> N;	while (N--) {		cin >> b;		if (b == "push") {			cin >> num;			a.push(num);		}		else if (b == "pop") {			if (a.empty() == true) {				cout << -1<<endl;			}			else {				cout << a.top() << endl;				a.pop();			}		}		else if (b == "size") {			cout << a.size() << endl;		}		else if (b == "empty") {			if (a.empty() == true) cout << 1 << endl;			else cout << 0 << endl;		}		else if (b == "top") {			if (a.empty() == true) {				cout << -1 << endl;			}			else cout << a.top() << endl;		}	}}